I'm saddened, devastated, horrified, & angry by what is happening in the 🌎 . My heart is with ALL the innocent human beings involved. I have felt extremely helpless so @annem.cart and I put this list together in case you feel like us & want to help but don't exactly know how. See below for some organizations to check out. They need our help NOW! More info in my stories. 

@jewishagency’s Fund for Victims of Terror provides immediate, critical financial assistance to victims & their families. They have already disbursed 100s of grants, arriving w/ checks within 24-48 hours.

@israaid - partnering with local & civil society organizations to coordinate humanitarian efforts, provide psychosocial support & urgent aid to vulnerable communities, evacuees & their families.

@magen_david_adom_america - Israel's red cross equivalent - national emergency medical, disaster, ambulance & blood bank service. 

@thepcrf - Humanitarian organization in Palestine delivering medical relief & aid to conflict victims. Serving immediate medical attention & basic necessities to children. 

@mecaforpeace - providing emergency assistance to families who have fled their homes to seek shelter with relatives or at schools that have become makeshift shelters,& procuring medical supplies for hospitals and clinics

@smartaidint - distributing essential relief items, including food, hygiene & dignity kits, socks, toys, blankets, &  tablets for children (social & education support) & families in a dozen kibbutzim in the south as well as areas in the north that have absorbed thousands of evacuated families.

#VoicesForHostages x @ncjwinc - 100s of kidnapped civilians are being held hostage by Hamas in unfathomable circumstances. Global women leaders raise their voices urging humanitarian aid & the safe & swift return of all hostages to their loved ones.

Just One Thing - Not asking for $. Match with an Israeli soldier. They’re asking for good deeds, mitzvot, kabbalahs. sharejustonething.com

